import React from 'react';
import { StyleSheet, Text, View } from 'react-native';

export default function ExerciseScreen() {
    return (
      <View style={styles.container}>
        <Text>Упражнение</Text>
      </View>
    )
  }
  

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
    },
  });
